import React from 'react';
import ReactPlayer from 'react-player/lazy';
import "./style.css";

const Card = (props) => (
  <div >

    {props.sample.cover && (
      <img className='img' src={props.sample.cover} alt=""/>
    )}
    {props.sample.webPreviewUrl && (
      <ReactPlayer 

        url={props.sample.webPreviewUrl}
        controls
      />
    )}

      <div className="mb-2">
        {props.sample.name}
      </div>
      {props.sample.link && (
        <a
          className="text-dark-500 hover:text-blue-600"
          href={props.sample.link}
          target="_blank"
          rel="noopener noreferrer"
        >
          Show the resource
        </a>
      )}

    </div>

);

export default Card;
